sys_variable_value.value:
(function execute(inputs, outputs) {

var payload = {}

if (inputs.name) { payload.name = inputs.name }
if (inputs.type) { payload.type = inputs.type }
if (inputs.symbol) { payload.symbol = inputs.symbol }
if (inputs.memo) { payload.memo = inputs.memo }
if (inputs.initial_supply) { payload.supply = inputs.initial_supply } //inconsistent
if (inputs.supply_type) { payload.supplytype = inputs.supply_type } //inconsistent
if (inputs.max_supply) { payload.maxsupply = inputs.max_supply } //inconsistent
if (inputs.decimals) { payload.decimals = inputs.decimals }

if (inputs.treasury_account) { payload.treasury = inputs.treasury_account } //inconsistent
if (inputs.admin_key) { payload.adminkey = inputs.admin_key }
if (inputs.supply_key) { payload.supplykey = inputs.supply_key }
if (inputs.freeze_key) { payload.freezekey = inputs.freeze_key }
if (inputs.pause_key) { payload.pausekey = inputs.pause_key }
if (inputs.wipe_key) { payload.wipekey = inputs.wipe_key }
if (inputs.kyc_key) { payload.kyckey = inputs.kyc_key }
if (inputs.sign_with) { payload.sign = inputs.sign_with } //inconsistent

outputs.cmd = JSON.stringify(payload)

})(inputs, outputs);

